DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `checkStatus`()
BEGIN   
SET SESSION time_zone = '-05:00';
    #unreliable
    UPDATE coupon SET status = 'unreliable' WHERE
        (status = 'active' OR status = 'future') AND
            ((expire_time IS NOT NULL AND expire_time != '0000-00-00' AND expire_time < CURDATE())
                );

    #future
    UPDATE coupon SET status = 'future' WHERE
        status = 'active'
        AND publish_time > CURDATE()
        AND (expire_time IS NULL OR expire_time = '0000-00-00' OR expire_time > CURDATE());

    #active
    UPDATE coupon SET status = 'active' WHERE
        status = 'future'
        AND (expire_time IS NULL OR expire_time = '0000-00-00' OR expire_time >= CURDATE())
        AND publish_time <= CURDATE();

    #unreliable
    UPDATE deal SET status = 'unreliable' WHERE
        (status = 'active' OR status = 'future') AND
            ((expire_time IS NOT NULL AND expire_time != '0000-00-00' AND expire_time < CURDATE())
                );

    #future
    UPDATE deal SET status = 'future' WHERE
        status = 'active'
        AND publish_time > CURDATE()
        AND (expire_time IS NULL OR expire_time = '0000-00-00' OR expire_time > CURDATE());

    #active
    UPDATE deal SET status = 'active' WHERE
        status = 'future'
        AND (expire_time IS NULL OR expire_time = '0000-00-00' OR expire_time >= CURDATE())
        AND publish_time <= CURDATE();
END;;
DELIMITER ;

